import GroceryForm from '../components/GroceryForm';
import GroceryList from '../components/GroceryList';
import { ViewContext } from '../lib/useView';

const Home = () => (
  <div>
    <ViewContext>
      <GroceryForm />
      <GroceryList />
    </ViewContext>
  </div>
);

export default Home;
